@testset "1.2.2.7 P(x) (d+e x^2)^q (a+b x^2+c x^4)^p" begin
    (A, B, a, b, c, d, e, q, x, ) = @variables A B a b c d e q x

    #= ::Package:: =#

    #= ::Title::Closed:: =#
    #=Integrands*of*the*form*P(x)*(d+e*x^2)^q*(a+b*x^2+c*x^4)^p=#


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*P2(x)*(d+e*x^2)^q*(a+b*x^2+c*x^4)^p*when*b=0=#


    #= ::Subsection:: =#
    #=Integrands*of*the*form*(A+B*x^2)*(d+e*x^2)^q*(a+c*x^4)^p=#


    #= ::Subsection::Closed:: =#
