    @test_int [(A + B*x^2)*(d + e*x^2)^3/sqrt(a + c*x^4), x, 15, (e*(21*B*c*d^2 + 21*A*c*d*e - 5*a*B*e^2)*x*sqrt(a + c*x^4))/(21*c^2) + (e^2*(3*B*d + A*e)*x^3*sqrt(a + c*x^4))/(5*c) + (B*e^3*x^5*sqrt(a + c*x^4))/(7*c) + ((5*B*c*d^3 + 15*A*c*d^2*e - 9*a*B*d*e^2 - 3*a*A*e^3)*x*sqrt(a + c*x^4))/(5*c^(3/2)*(sqrt(a) + sqrt(c)*x^2)) - (a^(1/4)*(5*B*c*d^3 + 15*A*c*d^2*e - 9*a*B*d*e^2 - 3*a*A*e^3)*(sqrt(a) + sqrt(c)*x^2)*sqrt((a + c*x^4)/(sqrt(a) + sqrt(c)*x^2)^2)*Elliptic.E(2*atan((c^(1/4)*x)/a^(1/4)), 1/2))/(5*c^(7/4)*sqrt(a + c*x^4)) + ((105*A*c^2*d^3 + 25*a^2*B*e^3 - 105*a*c*d*e*(B*d + A*e) - 63*a^(3/2)*sqrt(c)*e^2*(3*B*d + A*e) + 105*sqrt(a)*c^(3/2)*d^2*(B*d + 3*A*e))*(sqrt(a) + sqrt(c)*x^2)*sqrt((a + c*x^4)/(sqrt(a) + sqrt(c)*x^2)^2)*Elliptic.F(2*atan((c^(1/4)*x)/a^(1/4)), 1/2))/(210*a^(1/4)*c^(9/4)*sqrt(a + c*x^4)), -((5*a*B*e^3*x*sqrt(a + c*x^4))/(21*c^2)) + (d*e*(B*d + A*e)*x*sqrt(a + c*x^4))/c + (e^2*(3*B*d + A*e)*x^3*sqrt(a + c*x^4))/(5*c) + (B*e^3*x^5*sqrt(a + c*x^4))/(7*c) - (3*a*e^2*(3*B*d + A*e)*x*sqrt(a + c*x^4))/(5*c^(3/2)*(sqrt(a) + sqrt(c)*x^2)) + (d^2*(B*d + 3*A*e)*x*sqrt(a + c*x^4))/(sqrt(c)*(sqrt(a) + sqrt(c)*x^2)) + (3*a^(5/4)*e^2*(3*B*d + A*e)*(sqrt(a) + sqrt(c)*x^2)*sqrt((a + c*x^4)/(sqrt(a) + sqrt(c)*x^2)^2)*Elliptic.E(2*atan((c^(1/4)*x)/a^(1/4)), 1/2))/(5*c^(7/4)*sqrt(a + c*x^4)) - (a^(1/4)*d^2*(B*d + 3*A*e)*(sqrt(a) + sqrt(c)*x^2)*sqrt((a + c*x^4)/(sqrt(a) + sqrt(c)*x^2)^2)*Elliptic.E(2*atan((c^(1/4)*x)/a^(1/4)), 1/2))/(c^(3/4)*sqrt(a + c*x^4)) + (A*d^3*(sqrt(a) + sqrt(c)*x^2)*sqrt((a + c*x^4)/(sqrt(a) + sqrt(c)*x^2)^2)*Elliptic.F(2*atan((c^(1/4)*x)/a^(1/4)), 1/2))/(2*a^(1/4)*c^(1/4)*sqrt(a + c*x^4)) + (5*a^(7/4)*B*e^3*(sqrt(a) + sqrt(c)*x^2)*sqrt((a + c*x^4)/(sqrt(a) + sqrt(c)*x^2)^2)*Elliptic.F(2*atan((c^(1/4)*x)/a^(1/4)), 1/2))/(42*c^(9/4)*sqrt(a + c*x^4)) - (a^(3/4)*d*e*(B*d + A*e)*(sqrt(a) + sqrt(c)*x^2)*sqrt((a + c*x^4)/(sqrt(a) + sqrt(c)*x^2)^2)*Elliptic.F(2*atan((c^(1/4)*x)/a^(1/4)), 1/2))/(2*c^(5/4)*sqrt(a + c*x^4)) - (3*a^(5/4)*e^2*(3*B*d + A*e)*(sqrt(a) + sqrt(c)*x^2)*sqrt((a + c*x^4)/(sqrt(a) + sqrt(c)*x^2)^2)*Elliptic.F(2*atan((c^(1/4)*x)/a^(1/4)), 1/2))/(10*c^(7/4)*sqrt(a + c*x^4)) + (a^(1/4)*d^2*(B*d + 3*A*e)*(sqrt(a) + sqrt(c)*x^2)*sqrt((a + c*x^4)/(sqrt(a) + sqrt(c)*x^2)^2)*Elliptic.F(2*atan((c^(1/4)*x)/a^(1/4)), 1/2))/(2*c^(3/4)*sqrt(a + c*x^4))]
    @test_int [(A + B*x^2)*(d + e*x^2)^2/sqrt(a + c*x^4), x, 12, (e*(2*B*d + A*e)*x*sqrt(a + c*x^4))/(3*c) + (B*e^2*x^3*sqrt(a + c*x^4))/(5*c) + ((5*B*c*d^2 + 10*A*c*d*e - 3*a*B*e^2)*x*sqrt(a + c*x^4))/(5*c^(3/2)*(sqrt(a) + sqrt(c)*x^2)) - (a^(1/4)*(5*B*c*d^2 + 10*A*c*d*e - 3*a*B*e^2)*(sqrt(a) + sqrt(c)*x^2)*sqrt((a + c*x^4)/(sqrt(a) + sqrt(c)*x^2)^2)*Elliptic.E(2*atan((c^(1/4)*x)/a^(1/4)), 1/2))/(5*c^(7/4)*sqrt(a + c*x^4)) + ((15*A*c^(3/2)*d^2 - 9*a^(3/2)*B*e^2 - 5*a*sqrt(c)*e*(2*B*d + A*e) + 15*sqrt(a)*c*d*(B*d + 2*A*e))*(sqrt(a) + sqrt(c)*x^2)*sqrt((a + c*x^4)/(sqrt(a) + sqrt(c)*x^2)^2)*Elliptic.F(2*atan((c^(1/4)*x)/a^(1/4)), 1/2))/(30*a^(1/4)*c^(7/4)*sqrt(a + c*x^4)), (e*(2*B*d + A*e)*x*sqrt(a + c*x^4))/(3*c) + (B*e^2*x^3*sqrt(a + c*x^4))/(5*c) - (3*a*B*e^2*x*sqrt(a + c*x^4))/(5*c^(3/2)*(sqrt(a) + sqrt(c)*x^2)) + (d*(B*d + 2*A*e)*x*sqrt(a + c*x^4))/(sqrt(c)*(sqrt(a) + sqrt(c)*x^2)) + (3*a^(5/4)*B*e^2*(sqrt(a) + sqrt(c)*x^2)*sqrt((a + c*x^4)/(sqrt(a) + sqrt(c)*x^2)^2)*Elliptic.E(2*atan((c^(1/4)*x)/a^(1/4)), 1/2))/(5*c^(7/4)*sqrt(a + c*x^4)) - (a^(1/4)*d*(B*d + 2*A*e)*(sqrt(a) + sqrt(c)*x^2)*sqrt((a + c*x^4)/(sqrt(a) + sqrt(c)*x^2)^2)*Elliptic.E(2*atan((c^(1/4)*x)/a^(1/4)), 1/2))/(c^(3/4)*sqrt(a + c*x^4)) + (A*d^2*(sqrt(a) + sqrt(c)*x^2)*sqrt((a + c*x^4)/(sqrt(a) + sqrt(c)*x^2)^2)*Elliptic.F(2*atan((c^(1/4)*x)/a^(1/4)), 1/2))/(2*a^(1/4)*c^(1/4)*sqrt(a + c*x^4)) - (3*a^(5/4)*B*e^2*(sqrt(a) + sqrt(c)*x^2)*sqrt((a + c*x^4)/(sqrt(a) + sqrt(c)*x^2)^2)*Elliptic.F(2*atan((c^(1/4)*x)/a^(1/4)), 1/2))/(10*c^(7/4)*sqrt(a + c*x^4)) - (a^(3/4)*e*(2*B*d + A*e)*(sqrt(a) + sqrt(c)*x^2)*sqrt((a + c*x^4)/(sqrt(a) + sqrt(c)*x^2)^2)*Elliptic.F(2*atan((c^(1/4)*x)/a^(1/4)), 1/2))/(6*c^(5/4)*sqrt(a + c*x^4)) + (a^(1/4)*d*(B*d + 2*A*e)*(sqrt(a) + sqrt(c)*x^2)*sqrt((a + c*x^4)/(sqrt(a) + sqrt(c)*x^2)^2)*Elliptic.F(2*atan((c^(1/4)*x)/a^(1/4)), 1/2))/(2*c^(3/4)*sqrt(a + c*x^4))]
    @test_int [(A + B*x^2)*(d + e*x^2)^1/sqrt(a + c*x^4), x, 8, (B*e*x*sqrt(a + c*x^4))/(3*c) + ((B*d + A*e)*x*sqrt(a + c*x^4))/(sqrt(c)*(sqrt(a) + sqrt(c)*x^2)) - (a^(1/4)*(B*d + A*e)*(sqrt(a) + sqrt(c)*x^2)*sqrt((a + c*x^4)/(sqrt(a) + sqrt(c)*x^2)^2)*Elliptic.E(2*atan((c^(1/4)*x)/a^(1/4)), 1/2))/(c^(3/4)*sqrt(a + c*x^4)) + (a^(1/4)*(3*sqrt(c)*(B*d + A*e) + (3*A*c*d - a*B*e)/sqrt(a))*(sqrt(a) + sqrt(c)*x^2)*sqrt((a + c*x^4)/(sqrt(a) + sqrt(c)*x^2)^2)*Elliptic.F(2*atan((c^(1/4)*x)/a^(1/4)), 1/2))/(6*c^(5/4)*sqrt(a + c*x^4)), (B*e*x*sqrt(a + c*x^4))/(3*c) + ((B*d + A*e)*x*sqrt(a + c*x^4))/(sqrt(c)*(sqrt(a) + sqrt(c)*x^2)) - (a^(1/4)*(B*d + A*e)*(sqrt(a) + sqrt(c)*x^2)*sqrt((a + c*x^4)/(sqrt(a) + sqrt(c)*x^2)^2)*Elliptic.E(2*atan((c^(1/4)*x)/a^(1/4)), 1/2))/(c^(3/4)*sqrt(a + c*x^4)) + (A*d*(sqrt(a) + sqrt(c)*x^2)*sqrt((a + c*x^4)/(sqrt(a) + sqrt(c)*x^2)^2)*Elliptic.F(2*atan((c^(1/4)*x)/a^(1/4)), 1/2))/(2*a^(1/4)*c^(1/4)*sqrt(a + c*x^4)) - (a^(3/4)*B*e*(sqrt(a) + sqrt(c)*x^2)*sqrt((a + c*x^4)/(sqrt(a) + sqrt(c)*x^2)^2)*Elliptic.F(2*atan((c^(1/4)*x)/a^(1/4)), 1/2))/(6*c^(5/4)*sqrt(a + c*x^4)) + (a^(1/4)*(B*d + A*e)*(sqrt(a) + sqrt(c)*x^2)*sqrt((a + c*x^4)/(sqrt(a) + sqrt(c)*x^2)^2)*Elliptic.F(2*atan((c^(1/4)*x)/a^(1/4)), 1/2))/(2*c^(3/4)*sqrt(a + c*x^4))]
    @test_int [(A + B*x^2)*(d + e*x^2)^0/sqrt(a + c*x^4), x, 3, (B*x*sqrt(a + c*x^4))/(sqrt(c)*(sqrt(a) + sqrt(c)*x^2)) - (a^(1/4)*B*(sqrt(a) + sqrt(c)*x^2)*sqrt((a + c*x^4)/(sqrt(a) + sqrt(c)*x^2)^2)*Elliptic.E(2*atan((c^(1/4)*x)/a^(1/4)), 1/2))/(c^(3/4)*sqrt(a + c*x^4)) + (a^(1/4)*(B + (A*sqrt(c))/sqrt(a))*(sqrt(a) + sqrt(c)*x^2)*sqrt((a + c*x^4)/(sqrt(a) + sqrt(c)*x^2)^2)*Elliptic.F(2*atan((c^(1/4)*x)/a^(1/4)), 1/2))/(2*c^(3/4)*sqrt(a + c*x^4))]
    @test_int [(A + B*x^2)/((d + e*x^2)^1*sqrt(a + c*x^4)), x, 3, -(((B*d - A*e)*atan((sqrt(c*d^2 + a*e^2)*x)/(sqrt(d)*sqrt(e)*sqrt(a + c*x^4))))/(2*sqrt(d)*sqrt(e)*sqrt(c*d^2 + a*e^2))) - ((sqrt(a)*B - A*sqrt(c))*(sqrt(a) + sqrt(c)*x^2)*sqrt((a + c*x^4)/(sqrt(a) + sqrt(c)*x^2)^2)*Elliptic.F(2*atan((c^(1/4)*x)/a^(1/4)), 1/2))/(2*a^(1/4)*c^(1/4)*(sqrt(c)*d - sqrt(a)*e)*sqrt(a + c*x^4)) + (a^(3/4)*((sqrt(c)*d)/sqrt(a) + e)^2*(B*d - A*e)*(sqrt(a) + sqrt(c)*x^2)*sqrt((a + c*x^4)/(sqrt(a) + sqrt(c)*x^2)^2)*Elliptic.Pi(-((sqrt(c)*d - sqrt(a)*e)^2/(4*sqrt(a)*sqrt(c)*d*e)), 2*atan((c^(1/4)*x)/a^(1/4)), 1/2))/(4*c^(1/4)*d*e*(c*d^2 - a*e^2)*sqrt(a + c*x^4))]
    @test_int [(A + B*x^2)/((d + e*x^2)^2*sqrt(a + c*x^4)), x, 6, (sqrt(c)*(B*d - A*e)*x*sqrt(a + c*x^4))/(2*d*(c*d^2 + a*e^2)*(sqrt(a) + sqrt(c)*x^2)) - (e*(B*d - A*e)*x*sqrt(a + c*x^4))/(2*d*(c*d^2 + a*e^2)*(d + e*x^2)) - ((B*c*d^3 - 3*A*c*d^2*e - a*B*d*e^2 - a*A*e^3)*atan((sqrt(c*d^2 + a*e^2)*x)/(sqrt(d)*sqrt(e)*sqrt(a + c*x^4))))/(4*d^(3/2)*sqrt(e)*(c*d^2 + a*e^2)^(3/2)) - (a^(1/4)*c^(1/4)*(B*d - A*e)*(sqrt(a) + sqrt(c)*x^2)*sqrt((a + c*x^4)/(sqrt(a) + sqrt(c)*x^2)^2)*Elliptic.E(2*atan((c^(1/4)*x)/a^(1/4)), 1/2))/(2*d*(c*d^2 + a*e^2)*sqrt(a + c*x^4)) + (A*c^(1/4)*(sqrt(a) + sqrt(c)*x^2)*sqrt((a + c*x^4)/(sqrt(a) + sqrt(c)*x^2)^2)*Elliptic.F(2*atan((c^(1/4)*x)/a^(1/4)), 1/2))/(2*a^(1/4)*d*(sqrt(c)*d - sqrt(a)*e)*sqrt(a + c*x^4)) + ((sqrt(c)*d + sqrt(a)*e)*(B*c*d^3 - 3*A*c*d^2*e - a*B*d*e^2 - a*A*e^3)*(sqrt(a) + sqrt(c)*x^2)*sqrt((a + c*x^4)/(sqrt(a) + sqrt(c)*x^2)^2)*Elliptic.Pi(-((sqrt(c)*d - sqrt(a)*e)^2/(4*sqrt(a)*sqrt(c)*d*e)), 2*atan((c^(1/4)*x)/a^(1/4)), 1/2))/(8*a^(1/4)*c^(1/4)*d^2*e*(sqrt(c)*d - sqrt(a)*e)*(c*d^2 + a*e^2)*sqrt(a + c*x^4))]
    @test_int [(A + B*x^2)/((d + e*x^2)^3*sqrt(a + c*x^4)), x, 7, (sqrt(c)*(5*B*c*d^3 - 9*A*c*d^2*e - a*B*d*e^2 - 3*a*A*e^3)*x*sqrt(a + c*x^4))/(8*d^2*(c*d^2 + a*e^2)^2*(sqrt(a) + sqrt(c)*x^2)) - (e*(B*d - A*e)*x*sqrt(a + c*x^4))/(4*d*(c*d^2 + a*e^2)*(d + e*x^2)^2) - (e*(5*B*c*d^3 - 9*A*c*d^2*e - a*B*d*e^2 - 3*a*A*e^3)*x*sqrt(a + c*x^4))/(8*d^2*(c*d^2 + a*e^2)^2*(d + e*x^2)) + ((3*A*e*(5*c^2*d^4 + 2*a*c*d^2*e^2 + a^2*e^4) - B*(3*c^2*d^5 - 10*a*c*d^3*e^2 - a^2*d*e^4))*atan((sqrt(c*d^2 + a*e^2)*x)/(sqrt(d)*sqrt(e)*sqrt(a + c*x^4))))/(16*d^(5/2)*sqrt(e)*(c*d^2 + a*e^2)^(5/2)) - (a^(1/4)*c^(1/4)*(5*B*c*d^3 - 9*A*c*d^2*e - a*B*d*e^2 - 3*a*A*e^3)*(sqrt(a) + sqrt(c)*x^2)*sqrt((a + c*x^4)/(sqrt(a) + sqrt(c)*x^2)^2)*Elliptic.E(2*atan((c^(1/4)*x)/a^(1/4)), 1/2))/(8*d^2*(c*d^2 + a*e^2)^2*sqrt(a + c*x^4)) + (c^(1/4)*(4*A*c*d^2 + sqrt(a)*sqrt(c)*d*(B*d - A*e) + a*e*(B*d + 3*A*e))*(sqrt(a) + sqrt(c)*x^2)*sqrt((a + c*x^4)/(sqrt(a) + sqrt(c)*x^2)^2)*Elliptic.F(2*atan((c^(1/4)*x)/a^(1/4)), 1/2))/(8*a^(1/4)*d^2*(sqrt(c)*d - sqrt(a)*e)*(c*d^2 + a*e^2)*sqrt(a + c*x^4)) - ((sqrt(c)*d + sqrt(a)*e)*(3*A*e*(5*c^2*d^4 + 2*a*c*d^2*e^2 + a^2*e^4) - B*(3*c^2*d^5 - 10*a*c*d^3*e^2 - a^2*d*e^4))*(sqrt(a) + sqrt(c)*x^2)*sqrt((a + c*x^4)/(sqrt(a) + sqrt(c)*x^2)^2)*Elliptic.Pi(-((sqrt(c)*d - sqrt(a)*e)^2/(4*sqrt(a)*sqrt(c)*d*e)), 2*atan((c^(1/4)*x)/a^(1/4)), 1/2))/(32*a^(1/4)*c^(1/4)*d^3*e*(sqrt(c)*d - sqrt(a)*e)*(c*d^2 + a*e^2)^2*sqrt(a + c*x^4))]


