    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*(d+e*x^4)^q*(a+b*x^2+c*x^4)^(p/2)=#


    #= ::Subsubsection::Closed:: =#
    #=p>0=#


    @test_int [sqrt(a + b*x^2 + c*x^4)/(a*d - c*d*x^4), x, 4, -((sqrt(b - 2*sqrt(a)*sqrt(c))*atanh((sqrt(b - 2*sqrt(a)*sqrt(c))*x)/sqrt(a + b*x^2 + c*x^4)))/(4*sqrt(a)*sqrt(c)*d)) + (sqrt(b + 2*sqrt(a)*sqrt(c))*atanh((sqrt(b + 2*sqrt(a)*sqrt(c))*x)/sqrt(a + b*x^2 + c*x^4)))/(4*sqrt(a)*sqrt(c)*d)]
    @test_int [sqrt(a + b*x^2 - c*x^4)/(a*d + c*d*x^4), x, 1, -((sqrt(b + sqrt(b^2 + 4*a*c))*atan((sqrt(b + sqrt(b^2 + 4*a*c))*x*(b - sqrt(b^2 + 4*a*c) - 2*c*x^2))/(2*sqrt(2)*sqrt(a)*sqrt(c)*sqrt(a + b*x^2 - c*x^4))))/(2*sqrt(2)*sqrt(a)*sqrt(c)*d)) + (sqrt(-b + sqrt(b^2 + 4*a*c))*atanh((sqrt(-b + sqrt(b^2 + 4*a*c))*x*(b + sqrt(b^2 + 4*a*c) - 2*c*x^2))/(2*sqrt(2)*sqrt(a)*sqrt(c)*sqrt(a + b*x^2 - c*x^4))))/(2*sqrt(2)*sqrt(a)*sqrt(c)*d)]


    #= ::Subsubsection:: =#
    #=p<0=#


    #= ::Title::Closed:: =#
    #=Integrands*of*the*form*x^m*(d+e*x+f*x^2)^(n/2)*(a^2+2*a*b*x^2+b^2*x^4)^(p/2)=#


    @test_int [x^1*sqrt(a^2 + 2*a*b*x^2 + b^2*x^4)*sqrt(c + e*x + d*x^2), x, 6, (e*(12*b*c*d - 16*a*d^2 - 7*b*e^2)*(e + 2*d*x)*sqrt(c + e*x + d*x^2)*sqrt(a^2 + 2*a*b*x^2 + b^2*x^4))/(128*d^4*(a + b*x^2)) + (b*x^2*(c + e*x + d*x^2)^(3/2)*sqrt(a^2 + 2*a*b*x^2 + b^2*x^4))/(5*d*(a + b*x^2)) - ((32*b*c*d - 80*a*d^2 - 35*b*e^2 + 42*b*d*e*x)*(c + e*x + d*x^2)^(3/2)*sqrt(a^2 + 2*a*b*x^2 + b^2*x^4))/(240*d^3*(a + b*x^2)) + (e*(4*c*d - e^2)*(12*b*c*d - 16*a*d^2 - 7*b*e^2)*sqrt(a^2 + 2*a*b*x^2 + b^2*x^4)*atanh((e + 2*d*x)/(2*sqrt(d)*sqrt(c + e*x + d*x^2))))/(256*d^(9/2)*(a + b*x^2))]
    @test_int [x^0*sqrt(a^2 + 2*a*b*x^2 + b^2*x^4)*sqrt(c + e*x + d*x^2), x, 6, -(((4*b*c*d - 16*a*d^2 - 5*b*e^2)*(e + 2*d*x)*sqrt(c + e*x + d*x^2)*sqrt(a^2 + 2*a*b*x^2 + b^2*x^4))/(64*d^3*(a + b*x^2))) - (5*b*e*(c + e*x + d*x^2)^(3/2)*sqrt(a^2 + 2*a*b*x^2 + b^2*x^4))/(24*d^2*(a + b*x^2)) + (b*x*(c + e*x + d*x^2)^(3/2)*sqrt(a^2 + 2*a*b*x^2 + b^2*x^4))/(4*d*(a + b*x^2)) - ((4*c*d - e^2)*(4*b*c*d - 16*a*d^2 - 5*b*e^2)*sqrt(a^2 + 2*a*b*x^2 + b^2*x^4)*atanh((e + 2*d*x)/(2*sqrt(d)*sqrt(c + e*x + d*x^2))))/(128*d^(7/2)*(a + b*x^2))]
    @test_int [1/x^1*sqrt(a^2 + 2*a*b*x^2 + b^2*x^4)*sqrt(c + e*x + d*x^2), x, 8, ((8*a*d^2 - b*e^2 - 2*b*d*e*x)*sqrt(c + e*x + d*x^2)*sqrt(a^2 + 2*a*b*x^2 + b^2*x^4))/(8*d^2*(a + b*x^2)) + (b*(c + e*x + d*x^2)^(3/2)*sqrt(a^2 + 2*a*b*x^2 + b^2*x^4))/(3*d*(a + b*x^2)) + (e*(8*a*d^2 - b*(4*c*d - e^2))*sqrt(a^2 + 2*a*b*x^2 + b^2*x^4)*atanh((e + 2*d*x)/(2*sqrt(d)*sqrt(c + e*x + d*x^2))))/(16*d^(5/2)*(a + b*x^2)) - (a*sqrt(c)*sqrt(a^2 + 2*a*b*x^2 + b^2*x^4)*atanh((2*c + e*x)/(2*sqrt(c)*sqrt(c + e*x + d*x^2))))/(a + b*x^2)]
    @test_int [1/x^2*sqrt(a^2 + 2*a*b*x^2 + b^2*x^4)*sqrt(c + e*x + d*x^2), x, 8, (((b*c + 4*a*d)*e + 2*d*(b*c + 2*a*d)*x)*sqrt(c + e*x + d*x^2)*sqrt(a^2 + 2*a*b*x^2 + b^2*x^4))/(4*c*d*(a + b*x^2)) - (a*(c + e*x + d*x^2)^(3/2)*sqrt(a^2 + 2*a*b*x^2 + b^2*x^4))/(c*x*(a + b*x^2)) + ((4*b*c*d + 8*a*d^2 - b*e^2)*sqrt(a^2 + 2*a*b*x^2 + b^2*x^4)*atanh((e + 2*d*x)/(2*sqrt(d)*sqrt(c + e*x + d*x^2))))/(8*d^(3/2)*(a + b*x^2)) - (a*e*sqrt(a^2 + 2*a*b*x^2 + b^2*x^4)*atanh((2*c + e*x)/(2*sqrt(c)*sqrt(c + e*x + d*x^2))))/(2*sqrt(c)*(a + b*x^2))]
    @test_int [1/x^3*sqrt(a^2 + 2*a*b*x^2 + b^2*x^4)*sqrt(c + e*x + d*x^2), x, 8, ((a*e + 2*(2*b*c + a*d)*x)*sqrt(c + e*x + d*x^2)*sqrt(a^2 + 2*a*b*x^2 + b^2*x^4))/(4*c*x*(a + b*x^2)) - (a*(c + e*x + d*x^2)^(3/2)*sqrt(a^2 + 2*a*b*x^2 + b^2*x^4))/(2*c*x^2*(a + b*x^2)) + (b*e*sqrt(a^2 + 2*a*b*x^2 + b^2*x^4)*atanh((e + 2*d*x)/(2*sqrt(d)*sqrt(c + e*x + d*x^2))))/(2*sqrt(d)*(a + b*x^2)) - ((8*b*c^2 + 4*a*c*d - a*e^2)*sqrt(a^2 + 2*a*b*x^2 + b^2*x^4)*atanh((2*c + e*x)/(2*sqrt(c)*sqrt(c + e*x + d*x^2))))/(8*c^(3/2)*(a + b*x^2))]
    @test_int [1/x^4*sqrt(a^2 + 2*a*b*x^2 + b^2*x^4)*sqrt(c + e*x + d*x^2), x, 8, ((2*a*c*e - (8*b*c^2 - a*e^2)*x)*sqrt(c + e*x + d*x^2)*sqrt(a^2 + 2*a*b*x^2 + b^2*x^4))/(8*c^2*x^2*(a + b*x^2)) - (a*(c + e*x + d*x^2)^(3/2)*sqrt(a^2 + 2*a*b*x^2 + b^2*x^4))/(3*c*x^3*(a + b*x^2)) + (b*sqrt(d)*sqrt(a^2 + 2*a*b*x^2 + b^2*x^4)*atanh((e + 2*d*x)/(2*sqrt(d)*sqrt(c + e*x + d*x^2))))/(a + b*x^2) - (e*(8*b*c^2 - a*(4*c*d - e^2))*sqrt(a^2 + 2*a*b*x^2 + b^2*x^4)*atanh((2*c + e*x)/(2*sqrt(c)*sqrt(c + e*x + d*x^2))))/(16*c^(5/2)*(a + b*x^2))]
    end
